// frontend/src/components/layout/Sidebar.js
import React from 'react';
import { Link, useLocation } from 'react-router-dom';

const Sidebar = () => {
  const location = useLocation();
  
  const isActive = (path) => {
    return location.pathname === path;
  };

  return (
    <div className="w-64 bg-white shadow-lg h-screen fixed left-0 top-0 z-40">
      <div className="p-6 border-b border-slate-200">
        <h2 className="text-2xl font-bold text-blue-600">Servix CMMS</h2>
        <p className="text-slate-600 text-sm mt-1">Maintenance Management</p>
      </div>
      
      <nav className="mt-6">
        <ul className="space-y-2 px-4">
          <li>
            <Link 
              to="/" 
              className={`flex items-center px-4 py-3 rounded-lg transition-colors duration-200 ${
                isActive('/') 
                  ? 'bg-blue-50 text-blue-700 border-r-2 border-blue-700' 
                  : 'text-slate-700 hover:bg-slate-100'
              }`}
            >
              <svg className="w-5 h-5 mr-3" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 12l2-2m0 0l7-7 7 7M5 10v10a1 1 0 001 1h3m10-11l2 2m-2-2v10a1 1 0 01-1 1h-3m-6 0a1 1 0 001-1v-4a1 1 0 011-1h2a1 1 0 011 1v4a1 1 0 001 1m-6 0h6" />
              </svg>
              Dashboard
            </Link>
          </li>
          
          <li>
            <Link 
              to="/equipment" 
              className={`flex items-center px-4 py-3 rounded-lg transition-colors duration-200 ${
                isActive('/equipment') 
                  ? 'bg-blue-50 text-blue-700 border-r-2 border-blue-700' 
                  : 'text-slate-700 hover:bg-slate-100'
              }`}
            >
              <svg className="w-5 h-5 mr-3" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 13.255A23.931 23.931 0 0112 15c-3.183 0-6.22-.62-9-1.745M16 6V4a2 2 0 00-2-2h-4a2 2 0 00-2-2v2m8 0V6a2 2 0 012 2v6a2 2 0 01-2 2H8a2 2 0 01-2-2V8a2 2 0 012-2V6" />
              </svg>
              Equipment
            </Link>
          </li>
          
          <li>
            <Link 
              to="/add-equipment" 
              className="flex items-center px-4 py-3 text-slate-700 hover:bg-slate-100 rounded-lg transition-colors duration-200"
            >
              <svg className="w-5 h-5 mr-3" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 6v6m0 0v6m0-6h6m-6 0H6" />
              </svg>
              Add Equipment
            </Link>
          </li>
        </ul>
      </nav>
      
      <div className="absolute bottom-6 left-6 right-6">
        <div className="border-t border-slate-200 pt-6">
          <div className="flex items-center">
            <div className="w-8 h-8 bg-blue-600 rounded-full flex items-center justify-center text-white text-sm font-medium">
              {JSON.parse(localStorage.getItem('user'))?.name?.charAt(0) || 'U'}
            </div>
            <div className="ml-3">
              <p className="text-sm font-medium text-slate-700">
                {JSON.parse(localStorage.getItem('user'))?.name || 'User'}
              </p>
              <p className="text-xs text-slate-500">
                {JSON.parse(localStorage.getItem('user'))?.role || 'User'}
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
